import React from 'react';
import {
    BrowserRouter as Link
} from "react-router-dom";
import "./App.css";

export default function Login() {
    return  (
        <div class="login-header">
            <h2>Login</h2>
            <form>
                <input id="login-box" type="username" placeholder="username" required>
                </input>
                <br/>
                <input id="login-box" type="password" placeholder="password" required>
                </input>
                <Link to="/home">
                    <button type="submit">Login</button>
                </Link>
            </form>
        </div>
    );
}
